import React, { useState, useEffect } from 'react';
import { TimetableCourse, COURSE_COLORS } from '../../types/timetable';
import './CourseModal.css';

interface CourseModalProps {
  course: TimetableCourse | null;
  defaultDay?: number;
  defaultPeriod?: number;
  onSave: (course: TimetableCourse) => void;
  onDelete?: () => void;
  onClose: () => void;
}

const CourseModal: React.FC<CourseModalProps> = ({
  course,
  defaultDay,
  defaultPeriod,
  onSave,
  onDelete,
  onClose
}) => {
  const [formData, setFormData] = useState<TimetableCourse>({
    courseName: '',
    professorName: '',
    classroom: '',
    dayOfWeek: defaultDay || 1,
    periodStart: defaultPeriod || 1,
    periodEnd: defaultPeriod || 1,
    credits: 3,
    colorCode: COURSE_COLORS[0],
    memo: ''
  });

  useEffect(() => {
    if (course) {
      setFormData(course);
    }
  }, [course]);

  const handleSubmit = (e: React.FormEvent) => {
    e.preventDefault();

    if (!formData.courseName.trim()) {
      alert('科目名を入力してください');
      return;
    }

    if (formData.periodStart > formData.periodEnd) {
      alert('開始時限は終了時限以下にしてください');
      return;
    }

    onSave(formData);
  };

  const handleChange = (field: keyof TimetableCourse, value: any) => {
    setFormData(prev => ({ ...prev, [field]: value }));
  };

  return (
    <div className="modal-overlay" onClick={onClose}>
      <div className="modal-content" onClick={(e) => e.stopPropagation()}>
        <div className="modal-header">
          <h2>{course ? '科目を編集' : '科目を追加'}</h2>
          <button className="close-button" onClick={onClose}>×</button>
        </div>

        <form onSubmit={handleSubmit}>
          <div className="form-group">
            <label>科目名 *</label>
            <input
              type="text"
              value={formData.courseName}
              onChange={(e) => handleChange('courseName', e.target.value)}
              placeholder="例: データ構造とアルゴリズム"
              required
            />
          </div>

          <div className="form-row">
            <div className="form-group">
              <label>教授名</label>
              <input
                type="text"
                value={formData.professorName || ''}
                onChange={(e) => handleChange('professorName', e.target.value)}
                placeholder="例: 山田太郎"
              />
            </div>

            <div className="form-group">
              <label>教室</label>
              <input
                type="text"
                value={formData.classroom || ''}
                onChange={(e) => handleChange('classroom', e.target.value)}
                placeholder="例: A101"
              />
            </div>
          </div>

          <div className="form-row">
            <div className="form-group">
              <label>曜日 *</label>
              <select
                value={formData.dayOfWeek}
                onChange={(e) => handleChange('dayOfWeek', Number(e.target.value))}
              >
                <option value={1}>月曜日</option>
                <option value={2}>火曜日</option>
                <option value={3}>水曜日</option>
                <option value={4}>木曜日</option>
                <option value={5}>金曜日</option>
              </select>
            </div>

            <div className="form-group">
              <label>開始時限 *</label>
              <select
                value={formData.periodStart}
                onChange={(e) => handleChange('periodStart', Number(e.target.value))}
              >
                {[1, 2, 3, 4, 5, 6, 7].map(p => (
                  <option key={p} value={p}>{p}限</option>
                ))}
              </select>
            </div>

            <div className="form-group">
              <label>終了時限 *</label>
              <select
                value={formData.periodEnd}
                onChange={(e) => handleChange('periodEnd', Number(e.target.value))}
              >
                {[1, 2, 3, 4, 5, 6, 7].map(p => (
                  <option key={p} value={p}>{p}限</option>
                ))}
              </select>
            </div>

            <div className="form-group">
              <label>単位数</label>
              <input
                type="number"
                step="0.5"
                min="0"
                max="10"
                value={formData.credits || ''}
                onChange={(e) => handleChange('credits', parseFloat(e.target.value))}
              />
            </div>
          </div>

          <div className="form-group">
            <label>色</label>
            <div className="color-picker">
              {COURSE_COLORS.map(color => (
                <button
                  key={color}
                  type="button"
                  className={`color-option ${formData.colorCode === color ? 'selected' : ''}`}
                  style={{ backgroundColor: color }}
                  onClick={() => handleChange('colorCode', color)}
                />
              ))}
            </div>
          </div>

          <div className="form-group">
            <label>メモ</label>
            <textarea
              value={formData.memo || ''}
              onChange={(e) => handleChange('memo', e.target.value)}
              placeholder="例: 中間試験あり"
              rows={3}
            />
          </div>

          <div className="modal-actions">
            {onDelete && (
              <button type="button" className="delete-button" onClick={onDelete}>
                削除
              </button>
            )}
            <button type="button" className="cancel-button" onClick={onClose}>
              キャンセル
            </button>
            <button type="submit" className="save-button">
              保存
            </button>
          </div>
        </form>
      </div>
    </div>
  );
};

export default CourseModal;
